DROP TABLE IF EXISTS ngo_rank;

CREATE TABLE `ngo_rank` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `rank` varchar(100) NOT NULL,
  `status` int(11) NOT NULL,
  `added_on` datetime NOT NULL,
  `modify_on` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `modify_by` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=10 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS ngo_user;

CREATE TABLE `ngo_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(50) NOT NULL,
  `alt_username` varchar(13) NOT NULL,
  `password` varchar(50) NOT NULL,
  `status` enum('0','1','2','3','4') NOT NULL,
  `type` enum('1','2','3') NOT NULL,
  `lastlogin` datetime NOT NULL,
  `added_on` date NOT NULL,
  `modify_on` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `modify_by` int(11) NOT NULL,
  `useridfk` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `username` (`username`),
  UNIQUE KEY `alt_username` (`alt_username`),
  KEY `id` (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=249 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS ngo_user_account;

CREATE TABLE `ngo_user_account` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `username` varchar(100) NOT NULL,
  `transaction_for` varchar(20) NOT NULL,
  `transaction_type` int(11) NOT NULL,
  `transaction_amount` varchar(10) NOT NULL,
  `transaction_date` date NOT NULL,
  `remarks` text NOT NULL,
  `status` int(11) NOT NULL,
  `added_on` datetime NOT NULL,
  `modify_on` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `modify_by` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=14 DEFAULT CHARSET=latin1;



DROP TABLE IF EXISTS ngo_user_detail;

CREATE TABLE `ngo_user_detail` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) NOT NULL,
  `username` varchar(110) NOT NULL,
  `old_username` varchar(20) NOT NULL,
  `father` varchar(110) NOT NULL,
  `name_title` varchar(100) NOT NULL,
  `father_title` varchar(100) NOT NULL,
  `gender` varchar(100) NOT NULL,
  `age` varchar(100) NOT NULL,
  `dob` date NOT NULL,
  `bank_branch` varchar(100) NOT NULL,
  `pincode` varchar(100) NOT NULL,
  `district` varchar(100) NOT NULL,
  `parents` text NOT NULL,
  `nominee` varchar(100) NOT NULL,
  `nominee_relation` varchar(100) NOT NULL,
  `nominee_title` varchar(100) NOT NULL,
  `nominee_address` text NOT NULL,
  `bank_name` varchar(100) NOT NULL,
  `account_holder` varchar(100) NOT NULL,
  `pan` varchar(20) NOT NULL,
  `mobile` varchar(20) NOT NULL,
  `email` varchar(100) NOT NULL,
  `address` text NOT NULL,
  `bank_account` varchar(100) NOT NULL,
  `bank_ifsc` varchar(100) NOT NULL,
  `user_type` int(11) NOT NULL,
  `amount` varchar(10) NOT NULL,
  `sponsor_id` varchar(100) NOT NULL,
  `sponsor_name` varchar(100) NOT NULL,
  `image` text NOT NULL,
  `status` enum('-1','0','1','2') NOT NULL,
  `added_by` varchar(20) NOT NULL,
  `added_on` datetime NOT NULL,
  `modify_on` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `modify_by` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`),
  UNIQUE KEY `username` (`username`)
) ENGINE=MyISAM AUTO_INCREMENT=249 DEFAULT CHARSET=latin1;



